function formatDateTime(t){const e=new Date(t),n=e.getFullYear(),o=String(e.getMonth()+1).padStart(2,"0"),i=String(e.getDate()).padStart(2,"0"),a=String(e.getHours()).padStart(2,"0"),c=String(e.getMinutes()).padStart(2,"0"),r=String(e.getSeconds()).padStart(2,"0");return`${n}-${o}-${i} ${a}:${c}:${r}`}const plugin=(t,e)=>{const n=e.config.lastModifiedText||"",o=e.config.repo;t.beforeEach(t=>{const{file:i}=e.route,a=`https://api.github.com/repos/${o}/commits?path=${i}`;return fetch(a,{method:"GET"}).then(t=>t.json()).then(t=>{const e=t[0].commit.committer.date,a=`https://github.com/${o}/commits/main/${i}`,c=formatDateTime(e),r=`\n          <blockquote>\n           <a href="${a}" target="_blank" style="color: #858585">${n+c}</a>\n           </blockquote>\n          `;document.getElementById("last-modified").innerHTML=r}),t+'<span id="last-modified"></span>'})};window.$docsify=window.$docsify||{},window.$docsify.plugins=(window.$docsify.plugins||[]).concat(plugin);